import router from "../Utils/router"
import IndexHome from "../Pages/HomePage";


export const RoutesData = {
    mains : [
        {
            url: router.home,
            component: IndexHome,
            layout: "investor",
            title: "Мои копирования",
        },
        {
            url: router.investor,
            component: IndexHome,
            layout: "investor",
            title: "Мои копирования",
        }
    ]
}
